import * as React from "react";
import { styled } from '@mui/material/styles';
import Box from "@mui/material/Box";
import CssBaseline from "@mui/material/CssBaseline";
import Paper from "@mui/material/Paper";
import Typography from "@mui/material/Typography";
import Link from "@mui/material/Link";
import Grid from '@mui/material/Grid';

function Copyright() {
  return (
    <Typography variant="body2" color="text.secondary">
      {"Copyright © "}
      <Link color="inherit" href="/">
        SupportED
      </Link>{" "}
      {new Date().getFullYear()}
      {"."}
    </Typography>
  );
}
const Item = styled(Paper)(({ theme }) => ({
  padding: theme.spacing(1),
  textAlign: 'center',
  color: theme.palette.text.secondary,
}));

const Address = styled(Typography)(({ theme }) => ({
  padding: theme.spacing(1),
  textAlign: 'left',
  color: theme.palette.text.primary,
}));

export default function FixedBottomNavigation() {
  return (
    <Box sx={{ pb: 7 }}>
      <CssBaseline />
      <Paper
        sx={{ position: "fixed", bottom: 0, left: 0, right: 0 }}
        elevation={3}
      >
      <Item>
        <Grid container>
        <Grid xs={6} md={4}>
          <Address>
            <Typography color={'red'}>Support <Typography color={'red'}>Support ED</Typography></Typography>
            <Typography>Contact Us</Typography>
            <Typography>Phone: 071 0000111/ 011 2000 111</Typography>
            <Typography>Email: supported@gmail.com</Typography>
          </Address>
        </Grid>
        <Grid xs={6} md={4}>
        
          <Copyright />
        </Grid>
        <Grid xs={6} md={4}>
          <Typography>My sticky footer can be found here.</Typography>
          <Copyright />
        </Grid>
      </Grid>
      </Item>
      </Paper>
    </Box>
  );
}
